CREATE TABLE Diretor (DiretorID int,Nome varchar(255));
CREATE TABLE Historia (HistoriaID int,Nome varchar(255),DiretorID int,Temporada int);
CREATE TABLE Episodio (EpisodioID int,Nome varchar(255),HistoriaID int,DataTransmissao Date,Duracao TIME);

